import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { createRoot } from 'react-dom/client';
import './i18n';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <App />
);

